      <script>
        /* menu scroll spy */
        $(document).ready(function() {
            var navmenu = $('.navbar ul')[0];
            var ms = new MenuSpy(navmenu);
        });
        $(document).ready(function() {
            var mobileMaxWidth = 768,
                lastClickTime = 0,
                $navbar = $('.navbar'),
                $toggler = $navbar.find('.navbar-toggler'),
                $nav = $navbar.find('ul');

            var navbarResp = function() {
                if ($(window).width() > mobileMaxWidth)
                    $navbar.addClass('navbar-desktop').removeClass('navbar-mobile');
                else
                    $navbar.addClass('navbar-mobile').removeClass('navbar-desktop');
            };
            var _ = navbarResp();
            window.onresize = navbarResp;

            /* uncomment to test mobile version of navbar  */
            // $navbar.addClass('navbar-mobile').removeClass('navbar-desktop');

            $toggler.click(function() {

                var interval = 200;
                var currClickTime = new Date().getTime();
                var diff = currClickTime - lastClickTime;
                lastClickTime = currClickTime;

                if (diff < interval) {
                    return false;
                } else {
                    if ($navbar.hasClass('navbar-open'))
                        $navbar.removeClass('navbar-open');
                    else
                        $navbar.addClass('navbar-open');
                }
            });

            $nav.find('a').click(function() {
                $navbar.toggleClass('navbar-open');
            });
        });

    </script>
